import "./NavBar.css";

function BarraNavegacion() {
    return (
        <div>
            <nav className="header-nav">
                <ul>
                    <li>Uno</li>
                    <li>Dos</li>
                    <li>Tres</li>
                    <li>Cuatro</li>
                </ul>
            </nav>
        </div>
    )
}

export default BarraNavegacion;
